import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Editor from './component/Editor';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/doc' element={<Editor />} />
      </Routes>
    </Router>
  );
}

export default App;
